import React, {useContext, useState} from "react";
import { TaskContext } from "../../context/TasksContext";
import TaskCard from "../tasks/TaskCard";


const Dashboard = () => {
  const tasks2 = useContext(TaskContext);
  // const [taskss, setTask] = useState([useContext(TaskContext)])
  console.log('The context..');
  return (
    <div className="container">
      <h1>Find your upcoming tasks</h1>
      {tasks2.map(({task}: any) => <TaskCard
        dated={task.dated}
        time={task.time}
        person={task.person}
        name={task.name}
      />)}
    </div>
  )
}
export default Dashboard;
